import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./css/styles.css"; // Adjust the path as necessary

import IdentityServer from "./is/IdentityServer";
import UsernamePassword from './is/UsernamePassword'; // Adjust the path as necessary

import Asgardeo from "./asgardeo/Asgardeo";


function App() {
  const HomeComponent = () => (
    <div className="centered">
      <img src="/images/wso2-logo.webp" alt="WSO2 Logo" width="100" />
      <h2>WSO2 Authentication Demo</h2>
      <Link className="mockbutton" to="/is/identityserver">Identity Server</Link>
      <Link className="mockbutton" to="/asgardeo/asgardeo">Asgardeo</Link>
    </div>
  );

  return (
    <Router>
      <Routes> {/* Use Routes to wrap Route components */}
        {/* Define Route for Root Path */}
        <Route exact path="/" element={<HomeComponent />} />

        {/* Other Defined Routes */}
        <Route path="/is/identityserver" element={<IdentityServer />} />

// In your React Router setup
<Route path="/usernamepassword" element={<UsernamePassword />} />



        <Route path="/asgardeo/asgardeo" element={<Asgardeo />} />
      </Routes>
    </Router>
  );
}

export default App;
